    puts TypeProcess.find(124).update(id: 124,facts: 'NARRA LA DEMANDA QUE LA SENORA KAROOL SUJHEY GONZALEZ CRUZ  SUFRIO UN ACCIDENTE DE TRANSITO EL DIA 29 DE SEPTIEMBRE DE 2014 EN LA LOCALIDAD DE ARANZAZU  DONDE SEGUN DIAGNOSTICO SUFRE LUXACION DE CODO VRS FRACTURA DE HUMERO DISTAL Y FUE REMITIDA AL HOSPITAL SANTA SOFIA DE CALDAS  DONDE INGRESA EL 30 DE SEPTIEMBRE 2014  ALLI ES VALORADA Y DESPUES DE VARIAS RADIOGRAFIAS SE DEFINE RX Y TAC DEL CODO IMAGEN DE FRACTURA EN CODILO HUMERAL LATERAL FRACTURA DE CUPULA RADIAL IMPACTADA  LESION RADIODENSA EN CARA ANTERIOR DE HUMERO DISTAL  SE PROGRAMA CIRUGIA PARA EL DIA 4 DE OCTUBRE DE 2014  AL ESTAR EN EL QUIROFANO LE DESCUBREN UNA LACERACION EN CARA INTERNA DEL CODO CON EDEMA SEVERO Y EL ALTO RIESGO DE INFECCION  SE APLAZA OSTEOSINTESIS HASTA CUANDO LAS CONDICIONES DE LOS TEJIDOS BLANDOS LO PERMITAN  SE LE REALIZAN LAS CURACIONES RESPECTIVAS Y EL DIA 15 DE OCTUBRE DE 2014 LE REALIZAN LA CIRUGIA CON HALLAZGOS QUE OBLIGAN A UNA SEGUNDA INTERVENCION  REALIZADA EL 19 DE OCTUBRE DE 2014 EL DIA 22 DE OCTUBRE 2014 SE ORDENO LA SALIDA CON CONTROL EN 15 DIAS  ANTE LOS DOLORES Y LAS MOLESTIAS QUE AUN PRESENTABA LA PACIENTE ES VALORADA DE MODO PARTICULAR A OTRO ORTOPEDISTA  EL CUAL DETERMINA QUE HAY UN FRAGMENTO OSEO DESPLAZADO SUBYACENTE AL CONDILO HUMERAL POR LO TANTO REQUIERE OTRA CIRUGIA  ES POR LO ANTERIOR QUE SOLICITA DE FORMA PRIORITARIA ESTE SERVICIO ANTE LA EPS COOMEVA  LA CUAL NO ATIENDE DE FORMA OPORTUNA A SU USUARIA Y ES POR ELLO QUE LA SENORA KAROOL SE VE EN LA OBLIGACION DE CONTRATAR DE FORMA PARTICULAR DICHA INTERVENCION  LA CUAL ES REALIZADA EL DIA 31 DE MARZO DE 2015 Y TERMINA SU EVOLUCION EL DIA 9 DE OCTUBRE DE 2015 ALEGA LA PARTE DEMANDANTE QUE A RAIZ DE LOS HECHOS NARRADOS LA SENORA GONZALEZ CRUZ PRESENTA SECUELAS PSICOLOGICAS POR SU LARGA Y PENOSA RECUPERACION  YA QUE DURANTE TODO ESTE TIEMPO NO SE PUDO VALER POR SI MISMA ASI MISMO ASEVERAN QUE LA RESPONSABILIDAD DEL HOSPITAL SANTA SOFIA EN LA OCURRENCIA DE LAS M