    puts TypeProcess.find(5262).update(id: 5262,facts: 'ANTE LA SITUACION QUE SE VIVIO EN LA CIUDAD DE MEDELLIN CON EL DESPLOME DE UNA TORRE DEL EDIFICIO SPACE Y POSTERIORMENTE LA IMPLOSION DE LAS DEMAS TORRES LAS AUTORIDADES COMPETENTES SE DIERON A LA TAREA DE CONSTATAR LA CALIDAD Y ESTABILIDAD DE LAS EDIFICACIONES CONSTRUIDAS POR EL GRUPO CDO EN LOS ULTIMOS ANOS ASI MISMO LAS QUE SE ENCONTRABAN EN ESTADO DE CONSTRUCCION ENTRE LAS CUALES ESTABA LA URBANIZACION ACUARELA DEL NORTE SITUADA EN EL MUNICIPIO DE COPACABANA  DEBIDO A QUE FUE INVERSIONES ACUARELA CONSTRUCTORA DE OBRAS SAS  MIEMBRO DEL GRUPO CDO  QUIEN ESTABA A CARGO DE LA CONSTRUCCION DE LA URBANIZACION ACUARELA DEL NORTE LA ALCALDIA DE COPACABANA CONTRATO UN ESTUDIO DE VULNERABILIDAD SISMICA CON EL OBJETO DE EVALUAR EL ESTADO DE SEGURIDAD ESTRUCTURAL DE LA CONSTRUCCION  LOS RESULTADOS DEL ESTUDIO INDICARON QUE LA CONSTRUCTORA INVERSIONES ACUARELA CONSTRUCTORA DE OBRAS SAS NO OBRO EN DEBIDA FORMA Y SIN LAS PRECAUCIONES QUE REQUIERE DESARROLLAR LA ACTIVIDAD DE LA CONSTRUCCION  LA CONSTRUCTORA OBTUVO EN LA OFICINA DE PLANEACION MUNICIPAL DE COPACABANA LA LICENCIA DE CONSTRUCCION EN CONSECUENCIA SE INDICA QUE LA OFICINA DE PLANEACION MUNICIPAL NO TOMO LAS MEDIDAS NECESARIAS Y TAMPOCO ACTUO DEBIDAMENTE AL OTORGARLE LA LICENCIA DE CONSTRUCCION A LA CONSTRUCTORA',state: 'REGISTRO MIGRADO SOBRESCRITO')
    puts TypeProcess.find(7742).update(id: 7742,facts: 'EL DIA 05 DE AGOSTO DE 2013 SE INTERVIENE QUIRURGICAMENTE AL SENOR MARIO ANDRES VILLA AGUINAGA POR FRACTURA SUFRIDA EN ACCIDENTE DE TRANSITO DICHA INTERVENCION LA REALIZO EL MEDICO JUAN MANUEL MARIN BALLESTAS MEDICO ADSCRITO AL HOSPITAL SAN JUAN DE DIOS DE SANTA FE DE ANTIOQUIA - EN DICHA INTERVENCION LE INCRUSTARON TORNILLOS PARA OBTENER CORRECTA CONSOLIDACION DEL HUESO EN LA FRACTURA NO OBSTANTE NO SE OBTUVO EL RESULTADO ESPERADO PUES LA FRACTURA DESPUES DE DOS MESES CONTINUABA SIN SOLDAR - ADUCE LA PARTE DEMANDANTE QUE EL PROCEDIMIENTO FUE MAL EJECUTADO PUES LOS TORNILLOS DE FIJACION DE FRACTURA SE COLOCARON MAL DE MANERA QUE LA FRACTURA NO SOLDO PERMANECIENDO ABIERTA LO CUAL DESENCADENO EN UNA INCAPACIDAD PARCIAL PERMANENTE - AL DEMANDANTE SE LE REALIZARON TRES CIRUGIAS PARA EXTRAER LOS TORNILLOS',state: 'REGISTRO MIGRADO SOBRESCRITO')
