    puts TypeProcess.find(9549).update(id: 9549,facts: 'EL DIA MIERCOLES 21 DE AGOSTO DE 2013 LE EMPEZO AL SENOR RUBEN DARIO CHIQUITO ROMERO DOLOR COLORACION E INFLAMACION EN EL OJO DERECHO ACOMPANADO DE CEFALEA CREYENDO QUE SE TRATABA DE UN ORZUELO SU ESPOSO LE REALIZO MEDICAMENTOS CASEROS  ANTE LA PERSISTENCIA Y AUMENTO DE LOS SINTOMAS DE LA ENFERMEDAD EL DOMINGO 25 DE AGOSTO DE 2013 SE TRASLADA HASTA LAS INSTALACIONES DE LA UNIDAD HOSPITALARIA “SAN ANTONIO DE PRADO” EN DONDE EL MEDICO LUIS FERNANDO OSORIO HOYOS LO DEJA HOSPITALIZADO DIAGNOSTICANDOLE UN POSIBLE GLAUCOMA  EL DIA LUNES 26 DE AGOSTO DE 2013 ES TRASLADADO A LA CLINICA DE ESPECIALIDADES OFTALMOLOGICAS EN EL MUNICIPIO DE ENVIGADO EN DONDE EL MEDICO EDISON HAMER CANO RENDON EN COMPANIA DE LA DOCTORA ZULUAGA LE CAMBIARON EL DIAGNOSTICO POR EL DE HERPES ZOSTER OCULAR  ANTE LA COMPLEJIDAD DE LA ENFERMEDAD EL DIA 06 DE SEPTIEMBRE DE 2013 ES HOSPITALIZADO EN LA CLINICA LEON XIII DE LA CIUDAD DE MEDELLIN PARA VALORACION POR INFECTOLOGIA EN DONDE LE CONFIRMAN EL DIAGNOSTICO  LOS RESULTADOS DEL TRATAMIENTO CON ANTIBIOTICOS NO FUERON LOS ESPERADOS MOTIVO POR EL CUAL FUE INTERVENIDO QUIRURGICAMENTE EN REITERADAS OPORTUNIDADES EN ESTE CENTRO MEDICO CLINICA LEON XIII PARA PRACTICARLE EL PROCEDIMIENTO CONOCIDO COMO VITRECTOMIA ANTERIOR CON VITRIOFAGO  SIN EMBARGO EL HERPES CONTINUO AVANZANDO EN EL PACIENTE AUMENTANDO DE MANERA OSTENSIBLE EL PORCENTAJE DE AFECTACION EN LOS OJOS DE TAL MANERA QUE NUEVAMENTE FUE OPERADO YA PARA EXTIRPARLE EL OJO DERECHO POR PERDIDA TOTAL DE LA VISION DEL MISMO',state: 'REGISTRO MIGRADO SOBRESCRITO')
    puts TypeProcess.find(9597).update(id: 9597,facts: '1 EL DIA 16 DE MAYO DE 2013 AL INTERIOR DEL ESTABLECIMIENTO PENITENCIARIO DE MEDIANA SEGURIDAD Y CARCELARIO DE MEDELLIN  CARCEL DE BELLAVISTA FALLECIO EL SENOR FRANCISCO ERNESTO MARTINEZ MONTOYA 2 LOS DEMANDANTES ASEGURAN QUE LA MUERTE DEL SENOR FRANCISCO ERNESTO MARTINEZ MONTOYA FUE RESULTADO DE FALTA OPORTUNA DE ATENCION MEDICA QUE REQUERIA AL PRESENTAR QUEBRANTOS DE SALUD Y AFIRMAN QUE LA MUERTE LES CAUSO PERJUICIOS ',state: 'REGISTRO MIGRADO SOBRESCRITO')
    puts TypeProcess.find(7124).update(id: 7124,facts: 'EL SENOR LUIS GONZALO MOLINA ARANGO INICIO RELACION LABORAL CON EL MUNICIPIO DE MEDELLIN Y O LA INSTITUCION UNIVERSITARIA PASCUAL BRAVO EL DIA 11 DE OCTUBRE DE 2012 Y FUE DESPEDIDO EL DIA 30 DE DICIEMBRE DE 2015  LAS LABORES FUERON REALIZADAS EN EL CARGO DE AUDITOR TRIBUTARIO POR CONTRATO DE PRESTACION DE SERVICIOS EN EL MUNICIPIO DE MEDELLIN ADUCE EL DEMANDANTE QUE EL CONTRATO LO FIRMO DIRECTAMENTE CON LA INSTITUCION UNIVERSITARIA PASCUAL BRAVO Y FUE EL MUNICIPIO DE MEDELLIN QUIEN DIO ORDENES E INSTRUCCIONES AL CONTRATISTA ADUCE TAMBIEN QUE EL DEMANDANTE CUMPLIA UN HORARIO ESTABLECIDO DE LUNES A VIERNES DE 0730 A 1730  ADUCE ASI MISMO QUE LA INSTITUCION UNIVERSITARIA PASCUAL BRAVO Y EL MUNICIPIO DE MEDELLIN SUSCRIBIERON VARIOS CONTRATOS INTERADMINISTRATIVOS EN LOS CUALES LA INSTITUCION UNIVERSITARIA SE OBLIGA A TITULO DE CONTRATISTA INDEPENDIENTE A RESPONDER POR LAS PRESTACIONES SOCIALES DEL PERSONAL QUE SE NECESITE CONTRATAR PARA EL DESARROLLO CABAL DE LOS CONTRATOS CELEBRADOS CON EL MUNICIPIO  MANIFIESTA EL DEMANDANTE QUE LE ADEUDAN PRESTACIONES LABORALES DE TODA INDOLE',state: 'REGISTRO MIGRADO SOBRESCRITO')
