    puts TypeProcess.find(7088).update(id: 7088,facts: 'EL 20 DE MARZO DE 2014 LA SENORA LUISA FERNANDA RESTREPO VELEZ DA A LUZ A SU HIJO MATIAS NARANJO RESTREPO EN EL HOSPITAL GENERAL DE MEDELLIN LUZ CASTRO DE GUTIERREZ - VEINTIUN DIAS DESPUES LA SENORA LUISA FERNANDA ACUDIO AL SERVICIO DE URGENCIAS DEL HOSPITAL GENERAL DE MEDELLIN LUZ CASTRO DE GUTIERREZ POR UN FUERTE COLICO EN DONDE SE LE PRACTICO UNA ECOGRAFIA PELVICA TRANSVAGINAL QUE REPORTO ECOS ENDOMETRIALES MIXTOS DE 17MM POR LO QUE SE PROGRAMA PARA CURETAJE - BIOPSIA - LA INTERVENCION QUIRURGICA SE REALIZO EL 12 DE ABRIL DE 2014 EN DONDE LA PACIENTE SUFRIO VARIOS DESGARRES CERVICALES Y UNA SEVERA HEMORRAGIA SIN EMBARGO EL SANGRADO CESO - LA PACIENTE PERMANECIO HOSPITALIZADA DURANTE APROXIMADAMENTE 15 DIAS MAS PARA TENERLA EN VIGILANCIA MEDICA - PARA EL 14 DE ABRIL DE 2014 LA SENORA LUISA FERNANDA SE LE PRACTICO UNA SEGUNDA ECOGRAFIA PELVICA Y POSTERIORMENTE A UNA RESONANCIA MAGNETICA PELVICA INDICANDOSE QUE LA PACIENTE PADECIA PANMETRITIS Y MOSTRABA SIGNOS DE MIOMETRITIS ENDOMETRITIS CRONICA - EL 20 DE ABRIL DE 2014 LA PACIENTE PONE EN CONOCIMIENTO AL MEDICO PRACTICANTE DEL CES SOBRE SENSACION DE UNA MASA DESCENDIENDO POR SU VAGINA QUIEN LE REALIZO UN TACTO VAGINAL E INDICA QUE EXTRAJO UN COAGULO DE SANGRE - LA DEMANDA INDICA QUE LA PACIENTE CONSTATO QUE SE TRATABA DE UNA GASA CUBIERTA DE TEJIDO PURULENTO',state: 'REGISTRO MIGRADO SOBRESCRITO')
    puts TypeProcess.find(8631).update(id: 8631,facts: 'EL 26 DE SEPTIEMBRE DE 2012 EL SENOR SALUSTIANO BERRIO BERRIO ES LLEVADO A LA NUEVA CLINICA SAGRADO CORAZON SAS CON UN FUERTE GOLPE EN LA CABEZA Y ROSTRO TRAS HABER SUFRIDO ACCIDENTE DE TRANSITO SIN EMBARGO SE LE INDICO QUE SU ESTADO EN EL SISTEMA DE SALUD EN COLOMBIA ERA DESAFILIADO Y QUE POR LO TANTO DEBIA DIRIGIRSE A UNA UNIDAD INTERMEDIA PUBLICA - LA ATENCION POR PARTE DE LA UNIDAD INTERMEDIA PUBLICA FUE DEFICIENTE PUES DESCONOCIERON LA GRAVEDAD DE LA LESION DEL SENOR SALUSTINO LE EXIGIERON INSTAURAR DENUNCIA EN LA FISCALIA Y FINALMENTE SOLO LE RECETARON NAPROXENO - ANTE UNA FALTA DE ATENCION OPORTUNA Y ADECUADA EL SENOR SALUSTIANO DEAMBULA CON CONSTANTE SALIDA DE LIQUIDO POR LA NARIZ CONVULSIONES E INCESANTE DOLOR DE CABEZA Y SE DESMAYA RAZON POR LA CUAL ES TRASLADADO AL HOSPITAL GENERAL DE MEDELLIN DONDE DIAGNOSTICAN FRACTURA DE LA BASE DEL CRANEO Y PERDIDA DE LIQUIDO CEFALORRAQUIDEO Y ES MANEJADO POR NEUROCIRUGIA - EL SENOR SALUSTIANO BERRIO QUEDO CON SECUELAS PERMANENTES DEBE LLEVAR PERMANENTEMENTE UNA MANGUERA INTERNA DEL CRANEO HASTA EL ESTOMAGO Y TOMAR MEDICAMENTES PARA LA EPILEPSIA PRODUCTO DE LA FALTA DE ATENCION OPORTUNA',state: 'REGISTRO MIGRADO SOBRESCRITO')
