    puts TypeProcess.find(427).update(id: 427,facts: 'EL SENOR JUAN DE JESUS VERA RAMIREZ EL 1 DE ENERO DE 2015 FUE VALORADO POR EL MEDICO LUIS ALEJANDRO SOLANO CUBILLOS EL DOCTOR LE DETECTO CREPITOS EN CAMPO PULMONAR IZQUIERDO Y DISMINUCION DEL MURMULLO VESICULAR BILATERAL PERO DESDE ENTONCES NO SENTIA MEJORIA  SE LE DIFICULTABA RESPIRAR PERDIO TOTALMENTE EL APETITO - EL DIA 18 DE ENERO DE 2015 FUE EN COMPANIA DE LUIS GUILLERMO AL HOSPITAL NUESTRA SENORA DE LA CANDELARIA EN EL MUNICIPIO DE GUARNE FUE INGRESADO A LAS  TRES Y VEINTE DE LA TARDE Y ES ATENDIDO POR LA DOCTORA CAROLINA ALICIA QUIEN REGISTRA LOS ANTECEDENTES EN SU HISTORIA CLINICA - DADO QUE LA CONDICION DEL SENOR JUAN DE JESUS VERA RAMIREZ FUE DECLIVE Y QUE SUS REQUERIMIENTOS DE OXIGENO SE FUERON HACIENDO MAYORES EL MISMO 18 DE ENERO DE 2016 SE ORDENO SU TRASLADO A LA CLINICA SOCIEDAD MEDICA DE RIONEGRO SOMER LAS OBSERVACIONES INICIALES FUERON LENGUA SABIRRAK MUCOSAS CON ABUNDANTES SECRECIONES CIANOSIS GENERALIZADA - EL DIAGNOSTICO REALIZADO POR ESTA INSTITUCION FUE INSUFICIENCIA RESPIRATORIA AGUDA - NEUMONIA ADQUIRIDA EN LA COMUNIDAD SEVERA - SINDROME DE DISFUNCION ORGANICA MULTIPLE PULMONAR RENAL CARDIACA HIPERTENSION ARTERIAL - FINALMENTE EL DIA 19 DE ENERO DE 2015 EL SENOR JUAN DE JESUS VERA RAMIREZ FUE DADO DE ALTA DE LA CLINICA SOMER DE LO QUE EL DEMANDANTE MANIFIESTA QUE LA ATENCION FUE SUPERFICIAL DESENCADENO LA MUERTE DE JUAN DE JESUS VERA RAMIREZ',state: 'REGISTRO MIGRADO SOBRESCRITO')
