    puts TypeProcess.find(9143).update(id: 9143,facts: 'EL SENOR JHON DAVID TABORDA PARA INICIOS DEL ANO 2006 SE ENCONTRABA RECLUIDO EN LA CARCEL BELLAVISTA CUMPLIENDO PENA PRIVATIVA DE LA LIBERTAD DE 45 MESES AL INGRESAR AL PENAL SE LE HACE EXAMEN MEDICO QUE INFORMA QUE INGRESA EN BUENAS CONDICIONES DE SALUD - EL DIA 23 DE ENERO DE 2006 EL PACIENTE EN CUESTION CONSULTA ANTE LA OFICINA DE SANIDAD DEL ESTABLECIMIENTO CARCELARIO POR DESVIACION DE TABIQUE NASAL Y ALLI LE DICTAMINAN PROBLEMAS OTORRINOLARINGOLOGICOS Y SE LE REMITE ANTE MEDICO ESPECIALISTA EN OTORRINOLARINGOLOGIA - EL DIA 02 DE ABRIL DE 2009 EL PACIENTE CONSULTA NUEVAMENTE POR LA MISMA SINTOMATOLOGIA INICIAL NUEVAMENTE SE HACE LA REMISION A MEDICO ESPECIALISTA Y SOLO HASTA EL 02 DE JUNIO DE 2009 SE HACE EFECTIVA LA REALIZACION DE LA ORDEN PARA PEDIR CITA CON EL MENCIONADO ESPECIALISTA OTORRINOLARINGOLOGO - EL DIA 24 DE JULIO DE 2009 SE LE DICTAMINA QUE LA INFECCION NASAL CON PUS HABIA INVADIDO VARIAS PIEZAS DENTALES Y SE HIZO NECESARIO HACER DRENAJE DE LAS MISMAS PARA EL 15 DE OCTUBRE DE 2009 COMIENZA SECRECION DE PUS FETIDA POR LA NARIZ Y SE LE DA MANEJO ANTIBIOTICO AL INTERIOR DE LA CARCEL - EL DIA 05 DE ABRIL DE 2010 SE ORDENA PARA CLINICOS PRE QUIRURGICOS Y PARA EL DIA 21 DE MAYO DE 2010 SE LLEVA A CABO CIRUGIA DE RINOSEPTOPLASTIA MAS TURBINOPLASTIA - EL MISMO DIA SE LE DA DE ALTA CLINICA Y ES LLEVADO AL CENTRO PENITENCIARIO DONDE SE LE HOSPITALIZA HASTA EL 24 DE MAYO DE 2010 - DESDE EL 28 DE MAYO DE 2010 HASTA EL 02 DE JULIO DE 2010 PERMANECE HOSPITALIZADO EN LA SANIDAD DEL CENTRO CARCELARIO - EL DIA 15 DE JULIO ES INTERVENIDO QUIRURGICAMENTE EN LA NARIZ NUEVAMENTE POR UNA FRACTURA EN LA MISMA DEBIDO A UNA CAIDA POR LAS ESCALERAS DEL PENAL - EL DETENIDO EN OCTUBRE DE 2011 SOLICITO SE LE CONCEDIERA PRISION DOMICILIARIA DADO SU DELICADO ESTADO DE SALUD LA CUAL FUE NEGADA POR EL JUZGADO PRIMERO DE EJECUCION DE PENAS Y MEDIDAS DE SEGURIDAD DE DESCONGESTION DE MEDELLIN PUESTO QUE PREVIAMENTE MEDICINA LEGA